    countDown: function countDown() {
      var that = this;
      var end = that.data_list.cretime * 1000;
      that.dinshiqi = setInterval(function () {
        var aa = that.addtimes(end);
        that.daojishi = aa.hours + ":" + aa.minutes + ":" + aa.seconds;
        if (aa.hours == "00" && aa.minutes == "00" && aa.seconds == "00") {
          clearInterval(that.dinshiqi);
        }
      }, 1000);
    },
    // 计算时间
    addtimes: function addtimes(time) {
      var dateNow = new Date();
      var timeDiff = time * 1000 - dateNow.getTime(); // 时间差的毫秒数
      var leavel1 = timeDiff % (24 * 3600 * 1000);
      var hours = Math.floor(leavel1 / (3600 * 1000));

      var leavel2 = timeDiff % (3600 * 1000);
      var minutes = Math.floor(leavel2 / (60 * 1000));

      var leavel3 = timeDiff % (60 * 1000);
      var seconds = Math.floor(leavel3 / 1000);
      if (hours < 10) {
        hours = "0" + hours;
      }
      if (minutes < 10) {
        minutes = "0" + minutes;
      }
      if (seconds < 10) {
        seconds = "0" + seconds;
      }
      var aa = {
        hours: hours,
        minutes: minutes,
        seconds: seconds };

      return aa;
    },
